    # a.set_title('Raw Data',font='Arial',fontsize=size(16))
    rcx.set_title('            Raw Data', font='Arial', fontsize=size(16))
    if npzf:ao.set_xlabel(r'k ($\frac{2\pi}{\AA}$)', font='Arial', fontsize=size(12))
