def mfri(event):
    global mfiti
    i=mfiti.get()
    if i<len(ev)-1:
        mfiti.set(i+1)
    else:
        mfiti.set(0)

def mflind():
    global mfiti
    ti = mfiti.get()
    if ti in mfi:
        for i in range(ti+1):
            if ti-i not in mfi:
                mfiti.set(ti-i)
                break
    elif ti in mfi_err:
        for i in range(ti+1):
            if ti-i not in mfi_err:
                mfiti.set(ti-i)
                break
    elif ti in mfi_x:
        for i in range(ti+1):
            if ti-i in mfi or ti-i in mfi_err:
                mfiti.set(ti-i)
                break
        if i == ti and ti != 0:
            mfiti.set(ti-1)


def mfrind():
    global mfiti
    ti = mfiti.get()
    if ti in mfi:
        for i in range(len(ev)-ti):
            if ti+i not in mfi:
                mfiti.set(ti+i)
                break
    elif ti in mfi_err:
        for i in range(len(ev)-ti):
            if ti+i not in mfi_err:
                mfiti.set(ti+i)
                break
    elif ti in mfi_x:
        for i in range(len(ev)-ti):
            if ti+i in mfi or ti+i in mfi_err:
                mfiti.set(ti+i)
                break
        if i == len(ev)-ti-1 and ti != len(ev)-1:
            mfiti.set(ti+1)


