def fmaccept():
    global mfi, mfi_x, mfi_err
    msave_state()
    i = mfiti.get()
    if i not in mfi:
        mfi.append(i)
    if i in mfi_x:
        mfi_x.remove(i)
    if i in mfi_err:
        mfi_err.remove(i)
    mfitplot()


def fmreject():
    global mfi, mfi_x, mfi_err, mbreject, flmreject, mirej
    msave_state()
    i = mfiti.get()
    flmreject *= -1
    if flmreject == 1:
        mirej = i
        mbreject.config(text='End Reject', bg='red')
    else:
        ti = sorted([i, mirej])
        for i in np.linspace(ti[0], ti[1], ti[1]-ti[0]+1, dtype=int):
            if i not in mfi_x:
                mfi_x.append(i)
            if i in mfi:
                mfi.remove(i)
            if i in mfi_err:
                mfi_err.remove(i)
        mbreject.config(text='Reject', bg='white')
        mfitplot()
    


